  <script type="text/html" id="sidenav-template">
      {{#parkinfo}}

         <li class="nav-item">{{AN}} ({{AC}})

                 {{#parks}}

      {{#wardinfo}}

      {{/wardinfo}}

        {{/wardinfo}}
    </tbody>
    </table>
  </script>
